import React, { Component } from "react";
import CollectionOverview from "../components/CollectionOverview";
import { Route } from "react-router-dom";
const Shop = ({ match }) => {
  return (
    <div className="shop-page">
      <Route to={`${match.path}`} component={CollectionOverview} />
    </div>
  );
};

export default Shop;
